import * as React from "react";
import "../CSS/Answering/Answering.scss";
import RoundTimer from "../CSS/Timer/ReminderTimer.scss";

const Testing = () => {
  console.log("Pressed");
};

let wwidth = window.innerWidth;

export interface Props {
  Question?: string;
  OptionA?: string;
  OptionB?: string;
  OptionC?: string;
  OptionD?: string;
}

class Answering extends React.Component<Props> {
  componentDidMount() {
    document.body.id = "Answering";
  }

  render() {
    const {
      Question = "2 x 2 = ? fuck",
      OptionA = "True",
      OptionB = "False",
      OptionC = "C",
      OptionD = "D",
    } = this.props;
    return (
      <div className="Answering-background-wrapper">
        <div className="Answering-Grid-wrapper">
          {/*The left grid*/}
          <div className="Answering-left">
            <div className="Answering-back-box">
              <button className="Answering-back-button">Back</button>
            </div>
            <div className="Answering-question-box">
              <p className="Answering-question-content">{Question}</p>
            </div>
            <div className="Answering-question-icon-box">
              <div>
                <p className="Answering-question-icon1">Answer</p>
                <p className="Answering-question-icon2">Answer</p>
              </div>
            </div>
            <div className="Answering-question-text-box">
              <p className="Answering-question-text">
                Click to choose the answer
              </p>
            </div>
          </div>
          {/*The right grid*/}
          <div className="Answering-right">
            <div className="Answering-Timer">
              <RoundTimer time={120} timerSize={360} />
            </div>
            <div className="Answering-muti-wrapper">
              <div className="Answering-muti-firstline">
                <button className="Answering-button" onClick={Testing}>
                  {OptionA}
                </button>
                <span className="Answering-muti-sec">
                  <button className="Answering-button">{OptionC}</button>
                </span>
              </div>
              <div className="Answering-muti-secondline">
                <button className="Answering-button">{OptionB}</button>
                <span className="Answering-muti-sec">
                  <button className="Answering-button">{OptionD}</button>
                </span>
              </div>
            </div>
          </div>
        </div>
        <div className="warn">content: "mobile not supported yet";</div>
      </div>
    );
  }
}

export default Answering;
